sap.ui.define(["sap/ui/test/Opa5"],function(e){"use strict";e.createPageObjects({onTheBrowserPage:{actions:{iChangeTheHashToObjectN:function(t){return this.waitFor(this.createAWaitForAnEntitySet({entitySet:"Objects",success:function(s){e.getHashChanger().setHash("/Books/"+s[t].ID)}}))},iChangeTheHashToTheRememberedItem:function(){return this.waitFor({success:function(){var t=this.getContext().currentItem.id;e.getHashChanger().setHash("/Books/"+t)}})},iChangeTheHashToSomethingInvalid:function(){return this.waitFor({success:function(){e.getHashChanger().setHash("/somethingInvalid")}})}},assertions:{iShouldSeeTheHashForObjectN:function(t){return this.waitFor(this.createAWaitForAnEntitySet({entitySet:"Objects",success:function(s){var a=e.getHashChanger(),n=a.getHash();e.assert.strictEqual(n,"Books/"+s[t].ID,"The Hash is correct")}}))},iShouldSeeTheHashForTheRememberedObject:function(){return this.waitFor({success:function(){var t=this.getContext().currentItem.id,s=e.getHashChanger(),a=s.getHash();e.assert.strictEqual(a,"Books/"+t,"The Hash is not correct")}})},iShouldSeeAnEmptyHash:function(){return this.waitFor({success:function(){var t=e.getHashChanger(),s=t.getHash();e.assert.strictEqual(s,"","The Hash should be empty")},errorMessage:"The Hash is not Correct!"})}}}})});